Sitting at a cafe feeling like doing some data analysis. So, let's have a look at a recent Tidy Tuesday dataset and see if we can make some fun out of it. 


::: {.cell}

```{.r .cell-code  code-fold="true" code-summary="Packages used in this post"}
library(tidyverse)
library(broom)
library(modelsummary)
library(marginaleffects)
library(estimatr)
library(ggsci)
library(gt)

theme_set(theme_minimal(base_size = 12))
```
:::


# Import

::: {.cell}

```{.r .cell-code}
data("mtcars")

mtcars <- 
  mtcars |> 
  mutate(cyl = as.factor(cyl))
```
:::


# EDA

More cylinders, more horsepowers is bad for fuel efficiency. 


::: {.cell}

```{.r .cell-code}
mtcars |> 
  ggplot(aes(hp, mpg)) + 
  geom_point()
```

::: {.cell-output-display}
![](index_files/figure-html/unnamed-chunk-3-1.png){width=672}
:::

```{.r .cell-code}
mtcars |> 
  ggplot(aes(as.factor(cyl), mpg)) + 
  geom_boxplot(aes(fill = as.factor(cyl))) +
  scale_fill_futurama()
```

::: {.cell-output-display}
![](index_files/figure-html/unnamed-chunk-3-2.png){width=672}
:::

```{.r .cell-code}
mtcars |> 
  ggplot(aes(as.factor(cyl), mpg)) + 
  geom_jitter(aes(color = as.factor(cyl))) +
  scale_color_futurama()
```

