# Model


::: {.cell}

```{.r .cell-code}
mod  <- 
  lm_robust(mpg ~ hp + disp + cyl, 
            data = mtcars)

mod_fixed <- 
  lm_robust(mpg ~ hp + disp, 
            fixed_effects = ~ cyl, 
            data = mtcars)


coef_names <- 
  c("hp" = "Gross horsepower",
    "disp" = "Displacement",
    "(Intercept)" = "Intercept")

modelsummary(model = list(
             "Without FE" = mod,
             "Fixed Effects" = mod_fixed), 
             fmt = 3, 
             stars = TRUE, 
             gof_map = c("rmse", "r.squared", "nobs"),
             coef_map = coef_names)
```

